INSERT INTO casos_exitos VALUES(2,1669929696893,1684189008505,1670502357859,1,2,'Vivi''s Party',replace('Licenciada Nohema **Mungua**, empresaria, quien lidera Vivis \n\n\n\n\nParty\nNohema Mungua se gradu de la carrera de Administracin de Empresas en CEUTEC La Ceiba.\nDurante su trayectoria como estudiante formo parte del equipo administrativo de CEUTEC La Ceiba, desempeando el cargo de Auxiliar de Caja y tambin apoyando en las actividades de graduacin.\nCon base a mi experiencia podra decirles que trabajen en lo que les gusta, luchen por sus ideas de negocio, sean perseverantes y disciplinados, establzcanse metas medibles y alcanzables y recordar que todo sacrificio tiene su recompensa.\nNohema se destaca por ser luchadora, perseverante, creativa, soadora y emprendedora; comenta que la actitud que se asume ante la vida es fundamental; que los pensamientos e ideas construyen realidades, pero para ello hay que actuar en consecuencia y ejecutar esas ideas.  \nSu principal emprendimiento Vivis Party, nace como resultado de una constante bsqueda de un modelo de negocio que le permitiera mejorar la economa familiar aplicando sus habilidades empresariales y as crecer profesionalmente.\n Vivis Party comenz hace 4 aos, su misin es brindar un servicio eficiente en el montaje y alquiler de mobiliario y equipo para todo tipo de eventos, cubriendo la expectativa de los clientes con calidad, puntualidad, responsabilidad e higiene. \nNohema menciona que est continuamente enfocada en su idea original, y est muy consciente que para satisfacer las necesidades de sus clientes se requiere innovacin continua, por lo cual est atenta para poder ofrecer un servicio competitivo y que se adapte a los cambios de moda o tendencia de mercado.\nAgradezco a CEI de Ceutec/Unitec por su compromiso de crear espacios para generar ideas de vanguardia y promover el emprendimiento a travs de este tipo proyectos que producen beneficio particular y colectivo a la sociedad y que incentivan a sus estudiantes a poder materializar su idea de negocio a travs de la experiencia de otros emprendedores.\nEl emprendedor es un soador que tiene la capacidad de convertir una idea en visin, y la visin en realidad','\n',char(10)),'Vivi''s party nos permite alquilar inmobiliario para nuestras fiestas.');
INSERT INTO inicios VALUES(1,'AMAMOS AYUDARTE A CRECER','Te lanzamos con toda la fuerza posible, porque sabemos que la necesitas y porque no es momento de ponerse limites.','Casos de exito','Es un espacio creativo ideal para que emprendedores, son?adores y personas innovadoras se conecten y a trave?s de procesos de incubacio?n y aceleracio?n puedan hacer realidad sus suen?os. Es un espacio en donde mentores certificados ayudan a estudiantes a crecer con sus proyectos, a que no se desmotiven y sigan luchando por sus suen?os, y en este mismo espacio se capacitan constantemente desde habilidades blandas, hasta el aprendizaje de las metodologi?as ma?s avanzadas para emprender.',1670473911364,1671150545247,1670541689436,1,1);
